import React, { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import Form from "react-bootstrap/Form";
//import logo1 from "../assets/logo.png";
import AuthService from "../service/auth-service";
import trainService from "../service/trainservice";

// import Button from "react-bootstrap/Button";
// import Form from "react-bootstrap/Form";
let b = localStorage.getItem("username");
let s = false;
if (b != undefined) {
  s = true;
}
const Header = () => {
  
  const [train, setTrain] = useState([]);
  const [train_name, setTrainName] = useState([]);

  const search = (e) => {
    
    const val = {
      train_name,
    };

    trainService
      .getByTrainName(val)
      .then((response) => {
        console.log("Train added successfully", response.data);
        //setTrain(response.data);

        localStorage.setItem("train_name", val.train_name);
        localStorage.setItem("train", response.data);

        window.location.href = "/TrainDetails";
      })
      .catch((error) => {
        console.log("Something went wrong", error);
      });
  };
  return (
    <header className="header">
      <div>
        <strong
          className="logo"
          style={{ color: "red", fontStyle: "italic", paddingRight: "20px" }}
        >
          {" "}
          RailYatri
        </strong>
        {/* <Link className="links" to="/">
          Home
        </Link>
        <Link className="links" to="/aboutus">
          About Us
        </Link>
        <Link className="links" to="/contact">
          Contact
        </Link>
        <Link className="links" to="/train">
          Train
        </Link> */}

        {/* <Form className="d-flex">
          <Form.Control
            type="search"
            placeholder="Search"
            className="me-2"
            aria-label="Search"
            style={{ marginLeft: "450px" }}
          />
          <Button type="search" style={{ marginLeft: "550px" }}>
            Search
          </Button>
        </Form> */}
      </div>

      <nav className="navbar" style={{ height: "30px" }}>
        <ul>
          <Link className="links" to="/">
            Home
          </Link>
          <Link className="links" to="/aboutus">
            About Us
          </Link>
          <Link className="links" to="/contact">
            Contact
          </Link>
          <Link className="links" to="/train">
            Train
          </Link>
          <Link className="links" to="/login">
            Login
          </Link>
          <Link className="links" to="/Adminlogin">
            Admin Login
          </Link>
          <Link className="links" to="/signup">
            Sign Up
          </Link>
        </ul>
      </nav>
      <Form className="d-flex">
        <Form.Control
          type="search"
          placeholder="Search"
          value={train_name}
          onChange={(e) => setTrainName(e.target.value)}
          className="me-2"
          aria-label="Search"
          style={{ marginLeft: "200px", height: "30px", width: "290px" }}
        />
        {/* <Link className="btn btn-sucess" to="/TrainDetails" id="search" variant="secondary" style={{marginRight: "30px", color: "white"}} 
            onClick={(e) => {
              search(e);
            }}>
              Search
            </Link> */}
        <button
          style={{ width: "70px", height: "32px", textAllign: "center" }}
          class="btn btn-warning homecontactbtn1"
          onClick={(e) => {
            search(e);
          }}
        >
          <Link to="/TrainDetails"> Search</Link>
        </button>
      </Form>
    </header>
  );
};

export default Header;
